script: |
  super -f text -I q11849.spq | sort > q11849.out

inputs:
  - name: q11849.spq
    data: |
      SELECT + col0, col2 AS col1 FROM tab0 (FORMAT parquet) WHERE ( 26 NOT BETWEEN - col0 + - col0 + - + col1 + - + ( + + col2 ) * + - col0 AND NULL );
  - name: tab0

outputs:
  - name: q11849.out
    data: |
      15	47
      87	10
      97	99
